&lt;li&gt;Large retaining force&lt;/li&gt;
&lt;li&gt;Low tightening torque&lt;/li&gt;
&lt;li&gt;Wide range of pressures from vacuum up to 1.0MPa&lt;/li&gt;
&lt;li&gt;This product is not intended for use in potable water systems&lt;/li&gt;
&lt;/ul&gt;

